a. $RDHL Buy on the dip when it goes blow $10.  When it dips low, I also buy 1-2 $10 calls for next year's expiration.

b. $NVAX I assess charts daily.  Buy when in the $220s, and sell covered calls when it hits the $240s.  When it goes back into the $220s or low $230s, I buy back the covered calls for cheap to lock in free money.  Rinse and repeat. Bullish
